import { Injectable } from '@angular/core';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

import { SERVER_API_URL } from 'app/app.constants';
import { createRequestOption } from 'app/shared';
import { IAlimentazioneVeicolo } from 'app/shared/model/alimentazione-veicolo.model';

type EntityResponseType = HttpResponse<IAlimentazioneVeicolo>;
type EntityArrayResponseType = HttpResponse<IAlimentazioneVeicolo[]>;

@Injectable({ providedIn: 'root' })
export class AlimentazioneVeicoloService {
    private resourceUrl = SERVER_API_URL + 'api/alimentazione-veicolos';

    constructor(private http: HttpClient) {}

    create(alimentazioneVeicolo: IAlimentazioneVeicolo): Observable<EntityResponseType> {
        return this.http.post<IAlimentazioneVeicolo>(this.resourceUrl, alimentazioneVeicolo, { observe: 'response' });
    }

    update(alimentazioneVeicolo: IAlimentazioneVeicolo): Observable<EntityResponseType> {
        return this.http.put<IAlimentazioneVeicolo>(this.resourceUrl, alimentazioneVeicolo, { observe: 'response' });
    }

    find(id: number): Observable<EntityResponseType> {
        return this.http.get<IAlimentazioneVeicolo>(`${this.resourceUrl}/${id}`, { observe: 'response' });
    }

    query(req?: any): Observable<EntityArrayResponseType> {
        const options = createRequestOption(req);
        return this.http.get<IAlimentazioneVeicolo[]>(this.resourceUrl, { params: options, observe: 'response' });
    }

    delete(id: number): Observable<HttpResponse<any>> {
        return this.http.delete<any>(`${this.resourceUrl}/${id}`, { observe: 'response' });
    }
}
